import React from 'react';

class App extends React.Component {
    render(){
        return(
            <div>
                <h2>Welcome To My App</h2>
                <form>
                    <div className="form-input">
                        <input
                        type="text"
                        name="firstName"
                        value=""
                        onChange={2}
                        />
                    </div>
                    <div className="form-input">
                        <input
                        type="text"
                        name="lastName"
                        value=""
                        onChange={2}
                        />
                    </div>
                </form>
            </div>
        )
    }
}

export default App;
